import org.apache.nifi.flowfile.FlowFile

import java.time.ZonedDateTime
import java.time.format.DateTimeFormatter

def format = DateTimeFormatter.ofPattern("yyyy-MM-dd'T'HH:mm:ss'Z'")

def flowFile = session.get()
if (!flowFile) return


def static FlowFile createFlowFile(ProcessSession session, String message, FlowFile file) {
    String batchId = file.getAttribute("batchId");
    String type = file.getAttribute("sourceType");
    file = session.putAttribute(file, "file_name", "metadata/sourcetype=${type}/batch_${batchId}_completed.metadata")
    return session.write(file, { outputStream ->
        outputStream.write(message.getBytes("UTF-8"))
    } as OutputStreamCallback)
}

String message = flowFile.getAttribute("completed_message")
String batchId = flowFile.getAttribute("batchId");
String type = flowFile.getAttribute("sourceType");

ZonedDateTime endTime = ZonedDateTime.now();
ZonedDateTime startTime = endTime.minusMinutes(35);

String batch = String.format(message,batchId, type, startTime.format(format), endTime.format(format));
flowFile = createFlowFile(session, batch, flowFile)
session.transfer(flowFile, REL_SUCCESS)

import org.apache.nifi.flowfile.FlowFile

import java.time.ZonedDateTime
import java.time.format.DateTimeFormatter

def format = DateTimeFormatter.ofPattern("yyyy-MM-dd'T'HH:mm:ss'Z'")

def flowFile = session.get()
if (!flowFile) return


def static FlowFile createFlowFile(ProcessSession session, String message, FlowFile file, String stage) {
    String batchId = file.getAttribute("batchId");
    String messageId = file.getAttribute("messageId")
    String type = file.getAttribute("sourceType")
    def newFlowFile = session.create(file)
    newFlowFile = session.putAttribute(newFlowFile, "file_name", "sourcetype=${type}/dsbatchid=${batchId}/messagestage=${stage.toLowerCase()}/${messageId}.json")
    return session.write(newFlowFile, { outputStream ->
        outputStream.write(message.getBytes("UTF-8"))
    } as OutputStreamCallback)
}

List<FlowFile> files = new ArrayList<>();

String message = flowFile.getAttribute("message")
String trd_message = flowFile.getAttribute("tr_message")
String messageId = flowFile.getAttribute("messageId")
String batchId = flowFile.getAttribute("batchId");
String type = flowFile.getAttribute("sourceType")
ZonedDateTime time = ZonedDateTime.now();

String batch = String.format(message, batchId, messageId, type, "BATCHED", time.format(format));
files.add(createFlowFile(session, batch, flowFile, "BATCHED"))

String enqueue = String.format(message, batchId, messageId, type, "ENQUEUE", time.plusSeconds(2).format(format));
files.add(createFlowFile(session, enqueue, flowFile, "ENQUEUE"));

String dqueue = String.format(message, batchId, messageId, type, "DEQUEUE", time.plusSeconds(4).format(format));
files.add(createFlowFile(session, dqueue, flowFile, "DEQUEUE"));

String trdsp = String.format(trd_message, batchId, messageId, type, "TR_DISPATCH", time.plusSeconds(5).format(format));
files.add(createFlowFile(session, trdsp, flowFile, "TR_DISPATCH"));

String awsdsp = String.format(message, batchId, messageId, type, "SUCCESS", time.plusSeconds(6).format(format));
files.add(createFlowFile(session, awsdsp, flowFile, "SUCCESS"));

String dbc = String.format(message, batchId, messageId, type, "COMPLETED", time.plusSeconds(6).format(format));
files.add(createFlowFile(session, dbc, flowFile, "COMPLETED"));


session.transfer(files, REL_SUCCESS)
session.remove(flowFile)

import org.apache.nifi.flowfile.FlowFile

import java.time.ZonedDateTime
import java.time.format.DateTimeFormatter

def format  = DateTimeFormatter.ofPattern("yyyy-MM-dd'T'HH:mm:ss'Z'")

def flowFile = session.get()
if (!flowFile) return


def static FlowFile createFlowFile(ProcessSession session, String message, FlowFile file, String stage) {
    String batchId = file.getAttribute("batchId");
    String messageId = file.getAttribute("messageId")
    def newFlowFile = session.create(file)
    newFlowFile = session.putAttribute(newFlowFile, "file_name", "batchId_${batchId}/messageId_${messageId}/stages/${stage.toLowerCase()}.json")
    return session.write(newFlowFile, { outputStream ->
        outputStream.write(message.getBytes("UTF-8"))
    } as OutputStreamCallback)
}

